import React, { useEffect, useState } from "react";
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListIcon from '@mui/icons-material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';

const drawerWidth = 240;

const leftNavItems = [
  ['Contact', 'contact'], 
  ['Portfolio', 'portfolio']
];

const rightNavItems = [
  ['Career', 'career'],
  ['Projects', 'projects']
];

function Navigation() {
  const [mobileOpen, setMobileOpen] = useState<boolean>(false);
  const [scrolled, setScrolled] = useState<boolean>(false);

  const handleDrawerToggle = () => {
    setMobileOpen((prevState) => !prevState);
  };

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 50);
    };
    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const scrollToSection = (section: string) => {
    if (section === 'resume') {
      window.open("https://drive.google.com/file/d/1r2Cc-znZDCqoxVRM9mKHJ-jXFjWym4or/view?usp=sharing", '_blank');
      return;
    }
    if (section === 'portfolio') {
      window.open("https://shaileeportfolio.my.canva.site/p", '_blank');
      return;
    }
    if (section === 'contact') {
      window.open("https://www.linkedin.com/in/shailee-patel/", '_blank');
      return;
    }

    const sectionElement = document.getElementById(section);
    if (sectionElement) {
      sectionElement.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <Box sx={{ display: 'flex' }}>
      <CssBaseline />
      <AppBar 
        component="nav" 
        elevation={0}
        className={`navigation-container ${scrolled ? 'scrolled' : ''}`}
      >
        <Toolbar className='nav-toolbar'>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ display: { sm: 'none' }, color: '#2F4156' }}
          >
            <MenuIcon />
          </IconButton>

          <Box sx={{ display: { xs: 'none', sm: 'flex' }, gap: '8px', flex: 1, justifyContent: 'space-between' }}>
            <Box sx={{ display: 'flex', gap: '8px' }}>
              {leftNavItems.map((item) => (
                <Button 
                  key={item[0]} 
                  onClick={() => scrollToSection(item[1])}
                  className="nav-item-button"
                >
                  {item[0]}
                </Button>
              ))}
            </Box>
            <Box sx={{ display: 'flex', gap: '8px' }}>
              {rightNavItems.map((item) => (
                <Button 
                  key={item[0]} 
                  onClick={() => scrollToSection(item[1])}
                  className="nav-item-button"
                >
                  {item[0]}
                </Button>
              ))}
            </Box>
          </Box>
        </Toolbar>
      </AppBar>
      <nav>
        <Drawer
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          ModalProps={{ keepMounted: true }}
          sx={{
            display: { xs: 'block', sm: 'none' },
            '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
          }}
        >
          <Box onClick={handleDrawerToggle} sx={{ textAlign: 'center' }}>
            <p className="mobile-menu-top"><ListIcon/>Menu</p>
            <Divider />
            <List>
              {[...leftNavItems, ...rightNavItems].map((item) => (
                <ListItem key={item[0]} disablePadding>
                  <ListItemButton sx={{ textAlign: 'center' }} onClick={() => scrollToSection(item[1])}>
                    <ListItemText primary={item[0]} />
                  </ListItemButton>
                </ListItem>
              ))}
            </List>
          </Box>
        </Drawer>
      </nav>
    </Box>
  );
}

export default Navigation;
